import React from "react";
import SkillsData from "./SkillsData";
import SkillInfo from "./SkillInfo";
const Skills = () => {
  return (
    <div>
      {SkillsData.map((skill) => (
        <SkillInfo key={skill.id} imgSrc={skill.img} info={skill.knowledge} />
      ))}
    </div>
  );
};

export default Skills;
